const initialState = {
    notifications: [],
}

export const loadAmount = (payload) => {
    return {
        type: "LOAD_NOTIFICATIONS",
        payload
    }
}

export default (state = initialState, action) => {
    switch(action.type) {
        case 'LOAD_NOTIFICATION': {
            const payload = action.payload
            return {
                notifications: [
                    ...payload
                ]
            }
        }
        default: {
            return state;
        }
    }
};
